import React from 'react'
import styled from "styled-components";

const StyledNavbar = styled.div`
  background-color: #2b3336;
  font-size: 32px;
  color: white;
  display:flex;
  justify-content:space-between;
  padding: 0 10px;
  max-width:1800px;
  margin:auto;

  a {
    color:white;
    text-decoration:none;
  }
`;

export default function Navbar() {
  return (
    <StyledNavbar>
        <a href=''>Men</a>
        <a href=''>Women</a>
        <a href=''>Kids</a>
        <h1></h1>
    </StyledNavbar>
  )
}
